import React, { useState } from 'react';
import axios from 'axios';

const CombineRules = () => {
    const [rules, setRules] = useState([{ ruleName: '', operator: 'AND' }]);
    const [combinedRule, setCombinedRule] = useState('');
    const [syntaxTree, setSyntaxTree] = useState(null);
    
    const handleAddRule = () => {
        setRules([...rules, { ruleName: '', operator: 'AND' }]);
    };

    const handleRemoveRule = (indexToRemove) => {
        const updatedRules = rules.filter((_, index) => index !== indexToRemove);
        setRules(updatedRules);
    };

    const handleRuleChange = (index, field, value) => {
        const newRules = [...rules];
        newRules[index][field] = value;
        setRules(newRules);
    };

    const handleSubmit = (e) => {
        e.preventDefault();

        const ruleNames = rules.map(rule => rule.ruleName);
        const operators = rules.map(rule => rule.operator);

        axios.post('http://127.0.0.1:5000/combine_rules', {
            rules: ruleNames,
            operators: operators
        }).then(response => {
            setCombinedRule(response.data.combined_rule);
            setSyntaxTree(response.data.syntax_tree);
        }).catch(error => {
            alert('Error Combining Rules: ' + error);
        });
    };

    // Component to render the syntax tree recursively
    const renderSyntaxTree = (node) => {
        if (!node) return null;

        return (
            <ul>
                {node.operator ? (
                    <>
                        <li><strong>{node.operator}</strong></li>
                        <li>{renderSyntaxTree(node.left)}</li>
                        <li>{renderSyntaxTree(node.right)}</li>
                    </>
                ) : (
                    <li>{node.rule}</li>
                )}
            </ul>
        );
    };

    return (
        <div className="bg-gray-200 p-6 rounded-lg shadow-lg w-full max-w-lg mx-auto">
            <h2 className="text-2xl font-semibold text-gray-800 mb-4">Combine Rules</h2>
            <form onSubmit={handleSubmit} className="space-y-4">
                {rules.map((rule, index) => (
                    <div key={index} className="space-y-2">
                        <label className="block text-gray-700">
                            Rule {index + 1}:
                            <input
                                type="text"
                                value={rule.ruleName}
                                onChange={(e) => handleRuleChange(index, 'ruleName', e.target.value)}
                                required
                                className="mt-1 w-full px-4 py-2 border border-gray-300 rounded-lg"
                            />
                            {index < rules.length && (
                                <div>
                                    <label className="block text-gray-700">
                                        Operator:
                                        <select
                                            value={rule.operator}
                                            onChange={(e) => handleRuleChange(index, 'operator', e.target.value)}
                                            className="mt-1 w-full px-4 py-2 border border-gray-300 rounded-lg"
                                        >
                                            <option value="AND">AND</option>
                                            <option value="OR">OR</option>
                                        </select>
                                    </label>
                                    <button
                                        type="button"
                                        onClick={() => handleRemoveRule(index)}
                                        className="bg-red-500 text-white px-4 py-2 rounded-lg"
                                    >
                                        Remove
                                    </button>
                                </div>
                            )}
                        </label>
                    </div>
                ))}
                <button
                    type="button"
                    onClick={handleAddRule}
                    className="w-full bg-green-500 text-white font-semibold py-2 rounded-lg"
                >
                    Add Another Rule
                </button>
                <button
                    type="submit"
                    className="w-full bg-blue-500 text-white font-semibold py-2 rounded-lg"
                >
                    Combine Rules
                </button>
            </form>

            {combinedRule && (
                <div className="mt-6">
                    <h3 className="text-xl font-semibold">Combined Rule:</h3>
                    <p className="text-gray-700">{combinedRule}</p>
                    <h3 className="text-xl font-semibold mt-4">Syntax Tree:</h3>
                    <div className="tree mt-2">
                        {renderSyntaxTree(syntaxTree)}
                    </div>
                </div>
            )}
        </div>
    );
};

export default CombineRules;
